import { useEffect } from 'react';
import './App.css';
import axios from 'axios';

function App() {
  const [product, setProduct] = useEffect([]);
  useEffect(() => {
    axios.get("https://reqres.in/api/users?page=2").then((resp) =>{
      console.log("resp is ", resp.data.data);
      setProduct(resp.data);
    });
  }, []);
  return (
    <div className="App">
      Nikhitha
    </div>
  );
}

export default App;
